INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (0.0, 4, 110501, 1, "カオリ（サマー）", 0.0, 24, 4, 24015, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 10021, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (0.0, 4, 110501, 2, "カオリ（サマー）", 0.0, 24, 1, 24016, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 10021, 4.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (0.0, 4, 110501, 3, "カオリ（サマー）", 0.0, 24, 4, 24017, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 10021, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (0.0, 1, 110501, 4, "カオリ（サマー）", 0.0, 24, 2, 24018, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 10021, 5.2);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (0.0, 5, 110501, 5, "カオリ（サマー）", 0.0, 24, 6, 24019, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 10021, 4.2);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (0.0, 2, 110501, 6, "カオリ（サマー）", 0.0, 24, 2, 24020, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 10021, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (0.0, 1, 110501, 7, "カオリ（サマー）", 0.0, 24, 6, 24021, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 10021, 6.4);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (0.0, 2, 110501, 8, "カオリ（サマー）", 0.0, 24, 2, 24022, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 10021, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (0.0, 6, 110501, 9, "カオリ（サマー）", 0.0, 24, 3, 24023, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 10021, 10.08);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (0.0, 1, 110501, 10, "カオリ（サマー）", 0.0, 24, 2, 24024, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10021, 5.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (0.0, 2, 110501, 11, "カオリ（サマー）", 0.0, 24, 2, 24025, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 10021, 0.0);
